import { Routes, Route, Navigate } from "react-router-dom";


const privateRoute = ({children, ...rest}) => {
    const isAuthenticated = false
    if (!isAuthenticated)
    return (
        <Routes>
            <Route {...rest}>{!isAuthenticated?<Navigate to='login'/> : children}</Route>
        </Routes>   
    )
}

export default privateRoute
